import React from 'react';
import { Line, Radar, Bar } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  RadialLinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  RadialLinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
);

export default function Dashboard() {
  const performanceData = {
    labels: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun'],
    datasets: [{
      label: 'Performance Score',
      data: [65, 72, 68, 80, 75, 85],
      borderColor: 'rgb(75, 192, 192)',
      tension: 0.1
    }]
  };

  const skillsData = {
    labels: ['Batting', 'Bowling', 'Fielding', 'Fitness', 'Strategy', 'Leadership'],
    datasets: [{
      label: 'Skills Assessment',
      data: [85, 70, 75, 80, 65, 90],
      backgroundColor: 'rgba(54, 162, 235, 0.2)',
      borderColor: 'rgb(54, 162, 235)',
      borderWidth: 1
    }]
  };

  return (
    <div className="space-y-6">
      <h1 className="text-3xl font-bold text-gray-800">Performance Dashboard</h1>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <div className="bg-white p-6 rounded-lg shadow">
          <h2 className="text-xl font-semibold mb-4">Progress Over Time</h2>
          <Line data={performanceData} />
        </div>

        <div className="bg-white p-6 rounded-lg shadow">
          <h2 className="text-xl font-semibold mb-4">Skills Analysis</h2>
          <Radar data={skillsData} />
        </div>
      </div>

      <div className="bg-white p-6 rounded-lg shadow">
        <h2 className="text-xl font-semibold mb-4">Recent Achievements</h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
          {['Century Scored', 'Five Wicket Haul', 'Match Winner'].map((achievement) => (
            <div key={achievement} className="p-4 border rounded-lg text-center">
              <p className="font-medium">{achievement}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
